import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/scrollbar";
import { PersonCircle, StarFill } from "react-bootstrap-icons";

function Testimonal() {

  return (
    <>
      <section>
        <div className="container">
          <div className="testimonal-top text-center text-white">
            <h3 className="bm-0">smiles and stories from</h3>
          </div>
          <div className="alums-tit text-center">
            <h2>Our Clients</h2>
          </div>
          <div className="customer-review">
            <Swiper
              spaceBetween={10}
              slidesPerView={5}
              freeMode={true}
              breakpoints={{
                320: {
                  slidesPerView: 1,
                },
                576: {
                  slidesPerView: 2,
                },
                992: {
                  slidesPerView: 3,
                },
                1200: {
                  slidesPerView: 5,
                },
              }}
              onSlideChange={() => console.log("slide change")}
              onSwiper={(swiper) => console.log(swiper)}
              className="main_slider33"
            >
              <SwiperSlide>
                <div className="review-box bg-white p-4">
                  <div className="rev-img text-center ">
                     <img src="\assets\pro-1.webp" className="img-fluid" />
                  </div>
                  <div className="rev-content">
                    <p>
                      ,Lorem ipsum dolor sit amet consectetur adipisicing elit.
                      Dolor similique laboriosam laborum sed, provident tempore
                      recusandae illo pariatur perferendis dolorum corrupti
                      accusamus commodi! Ratione quo exercitationem in suscipit
                      ullam pariatur.
                    </p>
                  </div>
                  <div className="rev-name">
                    <h5>Michel</h5>
                    <p>London</p>
                  </div>
                  <div className="rev-star text-warning">
                    <StarFill />
                    <StarFill />
                    <StarFill />
                    <StarFill />
                    <StarFill />
                    <StarFill />
                  </div>
                </div>
              </SwiperSlide>
            </Swiper>
          </div>
        </div>
      </section>
    </>
  );
}

export default Testimonal;
